/**
 * @brief unlock notify of smart lock service
 * @param event    [event content]
 * @param attr     [event details]
 * @return int64_t [event uuid, get error code from errno when return negative value]
*/
int64_t smart_lock_unlock_notify(struct smart_lock_event_unlock *event, struct hey_event_notify_attr *attr)
{
    int64_t ret = -1;

    Iot__Service__SmartLock__EventUnlock *ev = NULL;
    uint8_t *buf = NULL;
    ev = malloc(sizeof(Iot__Service__SmartLock__EventUnlock));
    if (NULL == ev) {
        errno = ENOMEM;
        return ret;
    }
    iot__service__smart_lock__event_unlock__init(ev);
    ev->door_open_direction_case = event->door_open_direction_case;
    switch (ev->door_open_direction_case) {
    case SMART_LOCK_EVENT_UNLOCK_DOOR_OPEN_DIRECTION_NOT_SET:
        break;
    case SMART_LOCK_EVENT_UNLOCK_DOOR_OPEN_DIRECTION_MECHANICAL:
        break;
    case SMART_LOCK_EVENT_UNLOCK_DOOR_OPEN_DIRECTION_UNLOCKOUTSIDE: {
        ev->unlockoutside = malloc(sizeof(Iot__Service__SmartLock__EventUnlock__UnlockOutside));
        if (NULL == ev->unlockoutside) {
            errno = ENOMEM;
            goto out;
        }
        iot__service__smart_lock__event_unlock__unlock_outside__init(ev->unlockoutside);
        assert(event->unlockoutside->n_detail);
        ev->unlockoutside->n_detail = event->unlockoutside->n_detail;
        ev->unlockoutside->detail = calloc(ev->unlockoutside->n_detail, sizeof(Iot__Service__SmartLock__EventUnlock__UnlockOutside__Detail *));
        if (NULL == ev->unlockoutside->detail) {
            errno = ENOMEM;
            goto out;
        }
        for (int i = 0; i < ev->unlockoutside->n_detail; i++) {
            ev->unlockoutside->detail[i] = malloc(sizeof(Iot__Service__SmartLock__EventUnlock__UnlockOutside__Detail));
            if (NULL == ev->unlockoutside->detail[i]) {
                errno = ENOMEM;
                goto out;
            }
            iot__service__smart_lock__event_unlock__unlock_outside__detail__init(ev->unlockoutside->detail[i]);
            ev->unlockoutside->detail[i]->usertype = event->unlockoutside->detail[i]->usertype;
            ev->unlockoutside->detail[i]->userid = event->unlockoutside->detail[i]->userid;
            ev->unlockoutside->detail[i]->method = event->unlockoutside->detail[i]->method;
        }
    } break;
    case SMART_LOCK_EVENT_UNLOCK_DOOR_OPEN_DIRECTION_UNLOCKINSIDE: {
        ev->unlockinside = malloc(sizeof(Iot__Service__SmartLock__EventUnlock__UnlockInside));
        if (NULL == ev->unlockinside) {
            errno = ENOMEM;
            goto out;
        }
        iot__service__smart_lock__event_unlock__unlock_inside__init(ev->unlockinside);
        ev->unlockinside->method = event->unlockinside->method;
    } break;
    default:
        break;
    }

    size_t buf_len;
    buf_len = iot__service__smart_lock__event_unlock__get_packed_size(ev);
    if (buf_len > 0) {
        buf = malloc(buf_len);
        if (NULL == buf) {
            errno = ENOMEM;
            goto out;
        }
        iot__service__smart_lock__event_unlock__pack(ev, buf);
    }

    struct hey_event_notify_content content = {
        .iid = SMART_LOCK_EVENT_UNLOCK,
        .importance = attr->importance,
        .uuid = attr->uuid,
        .ref_uuid = attr->ref_uuid,
        .timestamp = attr->timestamp,
        .len = buf_len,
        .value = buf,
    };
    ret = hey_event_notify(smart_lock_service, &content, smart_lock_unlock_notify_result_cb, attr->ctx);

out:
    switch (ev->door_open_direction_case) {
    case SMART_LOCK_EVENT_UNLOCK_DOOR_OPEN_DIRECTION_MECHANICAL:
        break;
    case SMART_LOCK_EVENT_UNLOCK_DOOR_OPEN_DIRECTION_UNLOCKOUTSIDE: {
        if (ev && ev->unlockoutside) {
            if (ev->unlockoutside->detail) {
                for (int i = 0; i < ev->unlockoutside->n_detail; i++) {
                    if (ev->unlockoutside->detail[i] == NULL)
                        break;
                    free(ev->unlockoutside->detail[i]);
                }
                free(ev->unlockoutside->detail);
            }
            free(ev->unlockoutside);
        }
    } break;
    case SMART_LOCK_EVENT_UNLOCK_DOOR_OPEN_DIRECTION_UNLOCKINSIDE: {
        if (ev && ev->unlockinside) {
            free(ev->unlockinside);
        }
    } break;
    default:
        break;
    }
    free(ev);
    free(buf);
    return ret;
}

